          'If the target would die, they enter <span data-tip="Resurrection" class="glossary" data-game="lol" style="white-space:pre; position:relative;"><a title="Death" href="/wiki/Death#Ways_to_prevent_death_when_reaching_zero_health"><img height="20" data-image-name="Revival icon.png" loading="lazy" decoding="async" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" width="20" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/7c/Revival_icon.png/revision/latest/scale-to-width-down/20?cb=20170714051127" data-image-key="Revival_icon.png" alt="Revival icon" class="lazyload"></a> <a href="/wiki/Death#Ways_to_prevent_death_when_reaching_zero_health" title="Death">resurrection</a></span> for a short time, becoming <span style="white-space:pre; position:relative;" class="glossary" data-game="lol" data-tip="Invulnerable"><a title="Invulnerability" href="/wiki/Invulnerability"><img height="20" data-image-key="Taric_Cosmic_Radiance.png" class="lazyload" loading="lazy" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/49/Taric_Cosmic_Radiance.png/revision/latest/scale-to-width-down/20?cb=20160608034537" decoding="async" width="20" data-image-name="Taric Cosmic Radiance.png" alt="Cosmic Radiance"></a> <a href="/wiki/Invulnerability" title="Invulnerability">invulnerable</a></span>, <span style="white-space:pre; position:relative;" class="glossary" data-game="lol" data-tip="Untargetable"><a href="/wiki/Untargetable" title="Untargetable"><img data-relevant="0" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" decoding="async" width="20" alt="Untargetable icon" height="20" loading="lazy" data-image-name="Untargetable icon.png" data-image-key="Untargetable_icon.png" class="lazyload" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/41/Untargetable_icon.png/revision/latest/scale-to-width-down/20?cb=20220206063243"></a> <a title="Untargetable" href="/wiki/Untargetable" class="mw-redirect">untargetable</a></span>, and <span class="glossary" data-game="lol" style="white-space:pre; position:relative;" data-tip="Lockout"><a title="Terminology (League of Legends)" href="/wiki/Terminology_(League_of_Legends)#Lockout"><img height="20" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/72/Lockout_icon_2.png/revision/latest/scale-to-width-down/20?cb=20210417234848" decoding="async" class="lazyload" data-image-key="Lockout_icon_2.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" width="20" loading="lazy" data-relevant="0" alt="Lockout icon 2" data-image-name="Lockout icon 2.png"></a> <a href="/wiki/Terminology_(League_of_Legends)#Lockout" title="Terminology (League of Legends)">unable to act</a></span>. They are <span style="white-space:pre; position:relative;" data-tip="Heal" data-game="lol" class="glossary"><a title="Healing" href="/wiki/Healing"><img class="lazyload" width="20" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-image-key="Heal_power_icon.png" decoding="async" loading="lazy" alt="Heal power icon" height="20" data-image-name="Heal power icon.png" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/e/e7/Heal_power_icon.png/revision/latest/scale-to-width-down/20?cb=20170909150244"></a> <a title="Healing" href="/wiki/Healing">healed</a></span> afterwards.',
        description:
          'If the target takes <span class="glossary" style="white-space:pre; position:relative;" data-game="lol" data-tip="Death"><a title="Death" href="/wiki/Death"><img data-image-key="Death.png" height="20" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/c/c3/Death.png/revision/latest/scale-to-width-down/20?cb=20200415031113" class="lazyload" width="20" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" decoding="async" data-image-name="Death.png" alt="Death" loading="lazy"></a> <a title="Death" href="/wiki/Death">fatal damage</a></span> within the duration, they enter <span style="white-space:pre; position:relative;" data-game="lol" data-tip="Resurrection" class="glossary"><a href="/wiki/Death#Ways_to_prevent_death_when_reaching_zero_health" title="Death"><img data-image-key="Revival_icon.png" class="lazyload" alt="Revival icon" decoding="async" data-relevant="0" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-image-name="Revival icon.png" width="20" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/7c/Revival_icon.png/revision/latest/scale-to-width-down/20?cb=20170714051127" height="20" loading="lazy"></a> <a href="/wiki/Death#Ways_to_prevent_death_when_reaching_zero_health" title="Death">resurrection</a></span> for 3 seconds, becoming <span style="white-space:pre; position:relative;" data-tip="Invulnerable" class="glossary" data-game="lol"><a href="/wiki/Invulnerability" title="Invulnerability"><img loading="lazy" decoding="async" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-relevant="0" alt="Cosmic Radiance" class="lazyload" data-image-key="Taric_Cosmic_Radiance.png" height="20" data-image-name="Taric Cosmic Radiance.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/49/Taric_Cosmic_Radiance.png/revision/latest/scale-to-width-down/20?cb=20160608034537" width="20"></a> <a title="Invulnerability" href="/wiki/Invulnerability">invulnerable</a></span>, <span class="glossary" style="white-space:pre; position:relative;" data-game="lol" data-tip="Untargetable"><a href="/wiki/Untargetable" title="Untargetable"><img loading="lazy" data-image-name="Untargetable icon.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/41/Untargetable_icon.png/revision/latest/scale-to-width-down/20?cb=20220206063243" data-image-key="Untargetable_icon.png" class="lazyload" alt="Untargetable icon" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" height="20" width="20" decoding="async" data-relevant="0"></a> <a title="Untargetable" class="mw-redirect" href="/wiki/Untargetable">untargetable</a></span>, and <span style="white-space:pre; position:relative;" class="glossary" data-tip="Lockout" data-game="lol"><a href="/wiki/Terminology_(League_of_Legends)#Lockout" title="Terminology (League of Legends)"><img data-image-name="Lockout icon 2.png" data-image-key="Lockout_icon_2.png" height="20" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/72/Lockout_icon_2.png/revision/latest/scale-to-width-down/20?cb=20210417234848" alt="Lockout icon 2" class="lazyload" decoding="async" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" loading="lazy" width="20"></a> <a href="/wiki/Terminology_(League_of_Legends)#Lockout" title="Terminology (League of Legends)">unable to act</a></span>. Afterwards, they revive while being <span style="white-space:pre; position:relative;" data-game="lol" class="glossary" data-tip="Heal"><a href="/wiki/Healing" title="Healing"><img src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-image-key="Heal_power_icon.png" data-relevant="0" decoding="async" class="lazyload" data-image-name="Heal power icon.png" width="20" loading="lazy" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/e/e7/Heal_power_icon.png/revision/latest/scale-to-width-down/20?cb=20170909150244" alt="Heal power icon" height="20"></a> <a href="/wiki/Healing" title="Healing">healed</a></span>.',
